import Nee_temasVue from "./Nee_temas.vue";
import Nee_ScreenSubirVue from '@/views/nee_documentos/Nee_ScreenSubir';
import AsignarDocumentosVue from '@/views/nee_documentos/components/AsignarDocumentos';
export default {
  data: function data() {
    return {
      colorx: '#8B0000',
      arregloTemas: [],
      menu: 0
    };
  },
  components: {
    Nee_temasVue: Nee_temasVue,
    Nee_ScreenSubirVue: Nee_ScreenSubirVue,
    AsignarDocumentosVue: AsignarDocumentosVue
  },
  mounted: function mounted() {
    var me = this;
    me.getTemas();
  },
  methods: {
    getTemas: function getTemas() {
      var me = this;
      me.$vs.loading();
      this.$http.get(this.$server_url + "neetTema?listadoTemas=yes").then(function (res) {
        me.$vs.loading.close();
        me.arregloTemas = res.data;
      }).catch(function (error) {
        me.$vs.loading.close();
        console.log(error);
      });
    }
  }
};
